import { useParams } from "react-router-dom";
import { help } from "../constants";

const Help = () => {
  const { help } = useParams();
  const helpPage = help.find((e) => e.toLowerCase() === help);
  return (
    <section
      className="pagecenter"
      dangerouslySetInnerHTML={{ __html: helpPage }}
    />
  );
};

export default Help;
